import logo from './logo.svg';
import './App.css';
import HomePage from './HomePage/HomePage';
import NavBar from './NavBar/NavBar';

function App() {
  return (
    <div className="App">
      <div className='background'>
        <NavBar />
        <div className='background-slant'>
        <HomePage />
        </div>
      </div>
    </div>
  );
}

export default App;
